import React from 'react';
import shipping from '../../images/shipping.png';
import payments from '../../images/payments.png';
import money from '../../imagesmoney-back.png';
import quality from '../../images/quality.png';

class Service extends React.Component {
	render() {
		return (
			<React.Fragment>
				<div className='container service'>
					<div className='row'>
						<div className='col-10 text-center'>
							<h2 className='service-title'>Why should you choose us?</h2>
						</div>
					</div>
					<div className='row'>
						<div className='col-3'>
							<img src={shipping} alt='image'/>
							<h3>Free shipping</h3>
						</div>
						<div className='col-3'>
							<img src={payments} alt='image'/>
							<h3>Easy payments</h3>
							</div>
						<div className='col-3'>
							<img src={money} alt='image'/>
							<h3>Money-back guarantee</h3>
							</div>
						<div className='col-3'>
						    <img src={quality} alt='image'/>
							<h3>Finest quality</h3>
							</div>
					</div>
				</div>
			</React.Fragment>
		)
	}
}

export default Service;
